import { Component } from '@angular/core';
import {CinemaService} from "./services/cinema.service";

@Component({
  selector: 'cinema',
  templateUrl: './cinema.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'AngularCinema';
}
